const Article = ({ imgurl, date, title }) => {
    return (
        <div className="gpt3__blog_container_article">
            <div className="gpt3__blog_container_article-image">
                <img src={imgurl} alt="imgurl" />
            </div>
        </div>
    )
}

export default Article
